// Profile.js
import React, { useState } from "react";
import "./Profile.css"; // Add your styles in Profile.css

const Profile = () => {
  // Sample user data
  const [user, setUser] = useState({
    id: 1,
    username: "john_doe",
    email: "john@example.com",
    name: "John Doe",
    profileImage: null, // You can set a default image URL here
  });

  // State to track whether editing mode is active
  const [isEditing, setIsEditing] = useState(false);

  // State to track the edited values
  const [editedValues, setEditedValues] = useState({
    username: user.username,
    email: user.email,
    name: user.name,
  });

  // Function to handle image upload
  const handleImageUpload = (e) => {
    const file = e.target.files[0];
    // Logic to upload and set the image
    // For simplicity, let's assume there's an updateProfileImage function
    // that takes the file and updates the user profile image
    updateProfileImage(file);
  };

  // Function to handle field editing
  const handleEditField = (field) => {
    setIsEditing(true);
    setEditedValues({ ...editedValues, [field]: user[field] });
  };

  // Function to handle field value change
  const handleFieldValueChange = (field, value) => {
    setEditedValues({ ...editedValues, [field]: value });
  };

  // Function to save edited values
  const handleSaveChanges = () => {
    // Logic to save the edited values
    // For simplicity, let's assume there's an updateProfile function
    // that takes the edited values and updates the user profile
    updateProfile(editedValues);
    setIsEditing(false);
  };

  return (
    <div className="profile-page">
      <div className="profile-header">
        <div className="profile-photo">
          <img
            src={user.profileImage || "/default-user-image.jpg"}
            alt="Profile"
          />
          <label htmlFor="image-upload" className="edit-photo-button">
            Edit
          </label>
          <input
            id="image-upload"
            type="file"
            accept="image/*"
            onChange={handleImageUpload}
          />
        </div>
      </div>
      <div className="profile-details">
        <div className="field">
          <label>Username:</label>
          {isEditing ? (
            <>
              <input
                type="text"
                value={editedValues.username}
                onChange={(e) =>
                  handleFieldValueChange("username", e.target.value)
                }
              />
              <button onClick={() => handleSaveChanges()}>Save</button>
            </>
          ) : (
            <>
              <span>{user.username}</span>
              <button onClick={() => handleEditField("username")}>Edit</button>
            </>
          )}
        </div>
        <div className="field">
          <label>Email:</label>
          {isEditing ? (
            <>
              <input
                type="text"
                value={editedValues.email}
                onChange={(e) =>
                  handleFieldValueChange("email", e.target.value)
                }
              />
              <button onClick={() => handleSaveChanges()}>Save</button>
            </>
          ) : (
            <>
              <span>{user.email}</span>
              <button onClick={() => handleEditField("email")}>Edit</button>
            </>
          )}
        </div>
        <div className="field">
          <label>Name:</label>
          {isEditing ? (
            <>
              <input
                type="text"
                value={editedValues.name}
                onChange={(e) => handleFieldValueChange("name", e.target.value)}
              />
              <button onClick={() => handleSaveChanges()}>Save</button>
            </>
          ) : (
            <>
              <span>{user.name}</span>
              <button onClick={() => handleEditField("name")}>Edit</button>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default Profile;
